import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Apartment from './Apartment.js';
import Home from './.';
import About from './About';
import apartmentsData from './appartements.json';

const App = () => {
  return (
    <Router>
      <div>
        <Routes>
          <Route exact path="/" render={() => <Home apartments={apartmentsData} />} />
          <Route path="/apartments/:id" render={({ match }) => <Apartment match={match} apartments={apartmentsData} />} />
          <Route path="/about" component={About} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
